import './App.css';

function App() {

  let posts = {color:'blue',fontSize:'30px'}     


  return (
    <div className="App">
      <div className="black-nav">
        <div style={ posts }>개발 blog</div>
      </div>
      <h4>{posts}</h4>
    </div>
  );
}

export default App;
